import React from 'react';
import './todo-group.css';

const TodoGroup = function () {
  <div>
    <h3>Todo</h3>
    <ul>
      <li>Reply email</li>
      <li>Meet Sarah</li>
      <li>Do laundry</li>
    </ul>
  </div>
};

export default TodoGroup;
